import React from "react";

import UsersList from "../components/UsersList";

const USERS = [
  {
    id: "1",
    name: "Dawa Zangpo",
    image:
      "https://images.pexels.com/photos/1066176/pexels-photo-1066176.jpeg?auto=compress&cs=tinysrgb&w=800",
    places: 3,
  },
];

const Users = () => {
  return <UsersList items={USERS} />;
};

export default Users;
